  false,\n\t\"url\": null,\n\t\"notes\": \"WASTE_RESTRICTED_SITES_IDEM_IN is a point
  shapefile that contains restricted waste site locations in Indiana, provided by
  personnel of Indiana Department of Environmental Management, Office of Land Quality
  (IDEM, OLQ) as of July 11, 2003 and was subsequently updated on June 3, 2004, January
  4, 2005, April 25, 2005 and July 27, 2006, January 24, 2007, June 4, 2009, October
  20, 2009, and April 16, 2010. The data set provided by IDEM was in an ESRI geodatabase
  format and the feature class was named \"RESTRICTED_WASTE_SITES.\" WASTE_RESTRICTED_SITES_IDEM_IN
  is attributed with facility names and federal identification numbers. The following
  is excerpted from the metadata provided by IDEM, OLQ for the source shapefile RESTRICTED_WASTE_SITES:
  \"This dataset consists of Restricted Waste Sites - sites that accept only specific
  types of solid waste that fall into three select categories, as defined by IAC 329
  10-2-159 of the Indiana Administrative Code.\"\",\n\t\"license_title\": null,\n\t\"extras\":
